### Summary of Core Topics and Concepts

The exam covers a range of topics in English grammar, syntax, and communication skills. Here are the core topics, concepts, and principles essential for the exam:

#### 1. **Sentence Structure**
   - **Simple Sentences**: Contain one independent clause.
   - **Compound Sentences**: Contain two or more independent clauses joined by coordinating conjunctions.
   - **Complex Sentences**: Contain one independent clause and at least one dependent clause.

#### 2. **Clauses**
   - **Independent Clauses**: Can stand alone as a sentence.
   - **Dependent Clauses**: Cannot stand alone and need an independent clause to complete the sentence.

#### 3. **Complements and Adjuncts**
   - **Complements**: Words or phrases that complete the meaning of the verb (e.g., direct objects, predicate nominatives).
   - **Adjuncts**: Optional elements that provide additional information (e.g., adverbial phrases).

#### 4. **Adjectival Clauses and Relative Pronouns**
   - **Adjectival Clauses**: Dependent clauses that function as adjectives.
   - **Relative Pronouns**: Words like "who," "which," and "that" that introduce adjectival clauses.

#### 5. **Verb Tenses and Aspects**
   - **Simple Present**: Used for habitual actions.
   - **Present Continuous**: Used for actions happening now.
   - **Past Continuous**: Used for actions that were happening at a specific time in the past.
   - **Present Perfect Continuous**: Used for actions that started in the past and continue to the present.

#### 6. **Verb Moods**
   - **Indicative**: Used for statements and questions.
   - **Imperative**: Used for commands and requests.
   - **Subjunctive**: Used for hypothetical situations.

#### 7. **Adverbs**
   - **Adverbs**: Words that modify verbs, adjectives, or other adverbs.
   - **Adverb Placement**: Adverbs can be placed with the subject, predicate, or both.

#### 8. **Prefixes and Suffixes**
   - **Prefixes**: Added to the beginning of a word to change its meaning.
   - **Suffixes**: Added to the end of a word to change its meaning or part of speech.

#### 9. **Connecting Words**
   - **Conjunctions**: Words that connect clauses or sentences (e.g., "and," "but," "so").
   - **Prepositions**: Words that show relationships between nouns and other words in the sentence.

#### 10. **Communication Skills**
   - **Politeness and Softening**: Using polite language and softened versions of sentences.
   - **Inquiring and Requesting**: Appropriate phrases for asking about availability and making requests.

